import React from "react";

const Account = () => (
  <div className="bg-white min-h-screen font-sans px-4 py-12">
    <h1 className="text-3xl font-bold text-black mb-8 text-center">My Account</h1>
    <div className="max-w-3xl mx-auto bg-white rounded-lg shadow p-6 border border-gold mb-8">
      {/* Profile Info Placeholder */}
      <div className="mb-6">
        <div className="font-semibold text-black mb-1">Name: John Doe</div>
        <div className="text-gold-dark text-sm mb-1">Email: john@example.com</div>
        <button className="px-4 py-2 bg-gold text-black rounded font-bold mt-2">Edit Profile</button>
      </div>
      {/* Order History Placeholder */}
      <div>
        <h2 className="text-xl font-bold text-black mb-4">Order History</h2>
        <div className="border-t border-gold pt-4">
          <div className="flex justify-between mb-2 text-black"><span>Order #1234</span><span>$2,499</span></div>
          <div className="flex justify-between mb-2 text-black"><span>Order #1233</span><span>$1,999</span></div>
        </div>
      </div>
    </div>
  </div>
);

export default Account;
